#include "User.h"USER::User::User() {    this->id = 0;    this->name = "";    this->club = 0;    this->position = 0;}USER::User::User(int64_t _id) {    this->id = _id;    this->name = "";    this->club = 0;    this->position = 0;}USER::User::User(int64_t _id, std::string _name, int _pos, int _club) : id(_id), name(_name), position(_pos), club(_club){}void USER::User::SetName(std::string name) {    this->name = name;}void USER::User::SetClub(int clubNumber) {    this->club = clubNumber;}void USER::User::SetPosition(int position) {    this->position = position;}std::string USER::User::GetName() {    return this->name;}int USER::User::GetClub() {    return this->club;}int USER::User::GetPosition() {    return this->position;}